import { doc, setDoc } from "firebase/firestore"; 
import { db } from "../../firebase";
let defaultPp =`data:image/png;base64,`
class User{
    constructor(
        Username,
        email="user@gmail.com",
        Uid="0000",
        profilPicture=defaultPp,
        status="fire ",
        bio="The end is the Begining "
    ){
        this.Username=Username || "User";
        this.email=email;
        this.Uid=Uid;
        this.profilPicture=profilPicture;
        this.status=status;
        this.bio=bio;
    }
}

async function addUserToDb(userName,email,Uid){
    try{
        let userObj = new User(userName,email,Uid);
        await setDoc( doc(db, "Users", Uid ) , {...userObj} );
    }
    catch(err){
        console.log("error while adding user to db",err);
    }
}

export default addUserToDb;